import React from 'react'

import './Carousel.css'

const Carousel = () => {
  return (
    <div className='carouselContainer'>
      <div class="img1"></div>
      <div class="img2"></div>
      <div class="img3"></div>
      <div class="img4"></div>
    </div>
  )
}

export default Carousel
